    public string Mensaje { get; set; }
    /*[Parameter] */
    public ViajeCompleto viaje { get; set; } = new ViajeCompleto();
    public IEnumerable<Viaje> viajes = new List<Viaje>();
    /*  [Parameter] */
    public List<ViajeCompleto> viajesCompletos { get; set; } = new List<ViajeCompleto>();
